<body ng-app="instantCepApp" style="padding-top: 100px;">

<nav class="navbar navbar-default navbar-fixed-top">
	<div class="container-fluid">
		<div class="navbar-header">
      <span class="navbar-brand">
        CEP instant Build Tool
      </span>
		</div>
	</div>
</nav>

<div class="container" ng-controller="MainController">

	<form ng-submit="submit()" class="form-horizontal">

		<div class="form-group">
			<label for="questionnaireSources" class="col-sm-2 control-label">questionnaire.zip</label>
			<div class="col-sm-9">
				<input type="file"
					   accept=".zip"
					   required
					   class="form-control"
					   id="questionnaireSources"
					   name="questionnaireSources"
					   ng-model="questionnaireSources"
					   file-select="zip">
			</div>
			<div class="col-sm-1 control-label text-left">
                <span ng-if="questionnaireSources">
                    ✓
                </span>
			</div>
		</div>

		<div class="form-group">
			<label for="indexHtml" class="col-sm-2 control-label">index.html</label>
			<div class="col-sm-9">
				<input type="file"
					   accept=".html"
					   required
					   class="form-control"
					   id="indexHtml"
					   name="indexHtml"
					   ng-model="indexHtml"
					   file-select="text">
			</div>
			<div class="col-sm-1 control-label text-left">
                <span ng-if="indexHtml">
                    ✓
                </span>
			</div>
		</div>

		<div class="form-group">
			<label for="scssfile" class="col-sm-2 control-label">Theme (Sass Variables)</label>
			<div class="col-sm-9">
				<input type="file"
					   accept=".scss"
					   required
					   class="form-control"
					   id="scssfile"
					   name="scssfile"
					   ng-model="scssFile"
					   file-select="text">
			</div>
			<div class="col-sm-1 control-label text-left">
                <span ng-if="scssFile">
                    ✓
                </span>
			</div>
		</div>

		<div class="form-group">
			<label for="translatefile" class="col-sm-2 control-label">translation.json</label>
			<div class="col-sm-6">
				<input type="file"
					   accept=".json"
					   required
					   class="form-control"
					   id="translatefile"
					   name="translatefile"
					   ng-model="translateFile"
					   file-select="text"/>
			</div>
			<div class="col-sm-3">
				<input type="text" required class="form-control" placeholder="language key (e.g. 'de')"
					   ng-model="languageCode"/>
			</div>
			<div class="col-sm-1 control-label text-left">
                <span ng-if="translateFile">
                    ✓
                </span>
			</div>
		</div>
		<div class="form-group">
			<label for="configFile" class="col-sm-2 control-label">portal.js</label>
			<div class="col-sm-9">
				<input type="file"
					   accept=".js"
					   required
					   class="form-control"
					   id="portalJs"
					   name="portalJs"
					   ng-model="portalJs"
					   file-select="text"/>
			</div>
			<div class="col-sm-1 control-label text-left">
        <span ng-if="portalJs">
          ✓
        </span>
			</div>
		</div>
		<div class="form-group">
			<label for="configFile" class="col-sm-2 control-label">configuration.json</label>
			<div class="col-sm-9">
				<input type="file"
					   accept=".json"
					   required
					   class="form-control"
					   id="configFile"
					   name="configFile"
					   ng-model="configFile"
					   file-select="text"/>
			</div>
			<div class="col-sm-1 control-label text-left">
                <span ng-if="configFile">
                  ✓
                </span>
			</div>
		</div>

		<div class="form-group">
			<div class="col-sm-offset-2 col-sm-10">
				<button type="submit" class="btn btn-primary">Build CEP</button>
			</div>
		</div>

	</form>

	<div class="row" ng-if="progress">
		<div class="col-sm-9 col-sm-offset-2">
			<div class="well">
				<compile-progress progress="progress" error="error"></compile-progress>
			</div>
		</div>
	</div>

</div>


<!-- progressbar template -->
<script type="text/ng-template" id="templates/progressBar.html">
	<div class="progress">
		<div class="progress-bar"
			 ng-class="{'progress-bar-info': !error.message && getProgress() !== 100, 'progress-bar-danger': error.message, 'progress-bar-success': !error.message && getProgress() === 100, 'active progress-bar-striped': getProgress() !== 100 && !error.message}"
			 style="width: {{getProgress()}}%;">
			<span></span>
		</div>
	</div>

	<ul class="list-unstyled">
		<li ng-repeat="(key, value) in progress">
			<strong>{{key}}</strong>:
			<span class="text-success" ng-if="value">✓</span>
			<span class="text-info" ng-if="!value">in progress...</span>
		</li>
	</ul>

	<div ng-if="error.message">
		<div class="alert alert-danger">
			<h4>Build failed! 😩 </h4>
			{{error.message}}
		</div>
	</div>
</script>

</body>
</html>
